import React from 'react';
import Navbar from 'component/navbar';
import style from './index.module.scss';
import { Swiper, SwiperSlide } from "swiper/react";

import "swiper/swiper.min.css";
import "swiper/components/pagination/pagination.min.css"
import "swiper/components/navigation/navigation.min.css"
import "./style.css";
import uac1 from 'assets/uac/uac1.png'
import uac2 from 'assets/uac/uac2.png'
import uac3 from 'assets/uac/uac3.png'
import uac4 from 'assets/uac/uac4.png'
import uac5 from 'assets/uac/uac5.png'
// import uac6 from 'assets/uac/uac6.png'
import SwiperCore, {
  Pagination, Navigation
} from 'swiper/core';
SwiperCore.use([Pagination, Navigation]);

export default function index() {
  return (
    <div className={style.bg}>
      <Navbar />
      <div className={style.moom}></div>
      <div className={style.text}>
        <span>不死突袭编年史</span>
        <span>-- UAC攻略论坛</span>
      </div>
      <ul className={style.star}>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
      </ul>
      <div className={style.bg1}>
        <div className={style.bg2}>
          <div className={style.bear}></div>
        </div>
      </div>
      <div className={style.swiperbox}>
        <div className={style.swiper}>
          <Swiper slidesPerView={1} spaceBetween={30} loop={true} pagination={{
            "clickable": true
          }} navigation={true} >
            <SwiperSlide ><img src={uac1} alt="" /></SwiperSlide>
            <SwiperSlide ><img src={uac2} alt="" /></SwiperSlide>
            <SwiperSlide ><img src={uac3} alt="" /></SwiperSlide>
            <SwiperSlide ><img src={uac4} alt="" /></SwiperSlide>
          </Swiper>
        </div>
        <div className={style.triangle}>
          <div className={style.smalltri}></div>
        </div>
      </div>
    </div>
  )
}
